import React from 'react';
import involvedCheck from '../../../style/involvedCheck/involvedCheck.module.css'


const Checkbox = ({title, options}) => {


	return (
		<fieldset>
			<legend><h3>{title}</h3></legend>
			{options.map(option => (
				<div key={option.id} id={option.id}>
					<input type={"checkbox"} name={title}
								 data-id={option.id}
								 id={`${option.id}_checkbox_${option.content}`}
								 value={option.content}></input>
					<label htmlFor={`${option.id}_checkbox_${option.content}`}>{option.content}</label>
				</div>
			))}
		</fieldset>
	);
};

export default Checkbox;
